import srcimage2 from '../../photos/portrait-young-adult-wearing-hoodie-mockup_23-2149296253.jpg';




const FashionLayout = () =>{

    return(
     <div>
        <div className="leftsidebox">
                            <div className="imagebox">
                                {/* <img src={srcimage1} alt="321"/> */}
                            </div>
                            <div className="imagebox">
                                {/* <img src={srcimage2} alt="312"/> */}
